let person = prompt("1 Number", "Harry Potter");
function add(a,b){
    let add = a + b;
    return add;
}
function sub(a,b){
    let sub = a - b;
    return sub;
}
function div(a,b){
    let div = a / b;
    div = div.toFixed(1);
    return div;

}
function multi(a,b){
    let multi = a * b;
    return multi;
}
export {add,sub,div,multi};
